Exercise is beneficial for people of all ages. In fact, WebMD states that exercise can boost brainpower, melt away stress and improve energy levels. Your elderly parent may have trouble getting up and going to the mailbox, so how can you or their assisted living facility encourage him or her to get more exercise and gain those benefits?.
.
I have put together a few tips that will show you how anyone can get more exercise‚Äîeven if mobility is an issue. Hopefully these can help make a big difference in your life!

1Ô∏è‚É£ Water Athletics

Even if your mom or dad has trouble walking or moving on the ground, perhaps moving in the water would be easier. While you will want to start slowly, trying swimming or water aerobics can be a great way to get more movement in his or her life. 
2Ô∏è‚É£ Chair Aerobics

Believe it or not, chair aerobics are a ‚Äúthing.‚Äù It is possible to get a good and well-rounded workout without ever standing up. There are DVDs and classes dedicated to this activity.

3Ô∏è‚É£ Old Fashioned Wheelchairs

While powered chairs are useful, and quite fast, there is nothing quite like a hand powered chair for getting a workout. You might be surprised by how much of a workout it can be to propel yourself around a room or facility using only your arms. 
4Ô∏è‚É£ Short Walks (If Possible)

Is it possible for your mom or dad to take a short walk, perhaps with someone to hold on to or a cane or walker for support? It may be that your parent is a bit embarrassed by the need for help. Don‚Äôt let embarrassment keep him or her from getting exercise. 
5Ô∏è‚É£ Try a Physical Therapist

