This week I wanted to touch on choosing artwork/wall decor for your home! 
How many times do you scroll Pinterest and see the same wall decor over and over...maybe I'm just sensitive to it?? While buying artwork and wall decor from big box stores can be convenient, I urge you to think outside the box! (Get it...? Big box store, think outside the box! üòÇ)
At The WAREhouse we search high and low for one-of-a-kind pieces vintage, new and custom! But if you aren't finding exactly what you want at our store, try thrift stores, antique malls or even get creative and make your own! Having something on your wall that has meaning to you is waaaaay more original and personal and will give your home that custom look rather than, "Hi, my entire home was purchased in one stop at [insert box store name here.]" 
Another quick tip when hanging your artwork...it should 99% of the time hang between 58-62 inches from the floor! 
